sys_variable_value.value:
(function execute(inputs, outputs) {
  var obj = {};
  obj["title"] = inputs.document.title;
  obj["url"] = inputs.document.url;
  obj["body"] = inputs.document.body;
  outputs.document = JSON.stringify(obj);
})(inputs, outputs);

